import React, { Component } from "react";
import NavbarDesktop from "./NavbarDesktop";
import NavbarMobile from "./NavbarMobile";
import "./Navbar.css";

class Navbar extends Component {
  render() {
    return (
      <NavbarDesktop menu={this.props.menu} />
    );
  }
}
export default Navbar;
